  function testIt() {
    console.log('test it!');
    console.log(dataArray);
    data.forEach(element => {
      setDataArray([...dataArray, {
        name: element.Bedrijfsnaam
      }

      ])

    });
  }

  return (
    <div className="App">
      <button onClick={e => testIt()}>Test it now!</button>
      <SearchComponent />
      <ListOfEntries data={data} />
    </div>
  );
}

